import React from 'react';
import { BrowserRouter as Router,Route, Link } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';



import './App.css';
import Home from './pages/Home';
import Resume from './pages/Resume'


class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render(){
    return (
      <Router>
        <Container fluid = {true} className = "p-4 px-5">
              <Navbar className="ml-2 " bg="white">
                <Nav>
                  <Link className="nav-link" to = "/" >Shashank Ginjpalli</Link>
                </Nav>
                <Nav className="ml-auto mr-2">
                  <a href = "./assets/files/ShashankGinjpalli_Resume.pdf">
                    <Link className="nav-link" to="/resume">Resum√©</Link>
                  </a>
                </Nav>
              </Navbar>
        </Container>

        <Route path='/' exact render={() => <Home />} />
        {/* <Route path = '/resume' render = {() => <Resume/>} /> */}
      </Router> 
    );
  }
}

export default App;
